        self.label.setText(_translate("CompressWidget", "<html><head/><body><p align=\"center\"><span style=\" font-size:10pt; font-weight:600; color:#931d13;\">江苏省师范生培养信息系统</span></p><p align=\"center\"><span style=\" font-size:14pt; font-weight:600;\">压缩工具</span></p></body></html>"))
        self.usageBtn.setText(_translate("CompressWidget", "使用说明"))
        self.pdfBtn.setText(_translate("CompressWidget", "PDF压缩"))
        self.videoBtn.setText(_translate("CompressWidget", "视频压缩"))
        self.settingsBtn.setText(_translate("CompressWidget", "设       置"))
        self.donateBtn.setText(_translate("CompressWidget", "打赏作者"))
        self.label_2.setText(_translate("CompressWidget", "<html><head/><body><p align=\"center\"><br/></p><p align=\"center\"><img src=\":/logo/github_change.png\" width=\"25\" height=\"25\"/><a href=\"https://github.com/jimmy-moqin/compressTools\"><span style=\" font-size:10pt; font-weight:600; text-decoration: underline; color:#000000;\"> MoQin 作品</span></a></p><p align=\"center\"><br/></p></body></html>"))
        self.label_3.setText(_translate("CompressWidget", "使用说明"))
        self.label_21.setText(_translate("CompressWidget", "<html><head/><body><p align=\"center\"><span style=\" font-size:14pt; font-weight:600; text-decoration: underline; color:#d80000;\">本软件</span><span style=\" font-size:14pt; color:#d80000;\">专为</span><span style=\" font-size:14pt; font-weight:600; color:#d80000;\">江苏省师范生培养信息系统</span><span style=\" font-size:14pt; color:#d80000;\">文件上传设计</span><span style=\" font-size:12pt; color:#d80000;\">。</span></p><p align=\"justify\"><span style=\" font-size:12pt;\">网站要求师范生提交的班团活动设计PDF单个文件大小不得超过</span><span style=\" font-size:12pt; font-weight:600;\">5M</span><span style=\" font-size:12pt;\">，单个视频大小不得超过</span><span style=\" font-size:12pt; font-weight:600;\">60M</span><span style=\" font-size:12pt;\">。因此本软件提供PDF压缩和视频压制两个功能。</span></p><p align=\"justify\"><span style=\" font-size:12pt;\">以下为使用说明，请使用者认真阅读。</span></p><p align=\"justify\"><span style=\" font-size:18pt; font-weight:600; color:#bf0000;\">·PDF压缩</span></p><p align=\"justify\"><span style=\" font-size:12pt; font-weight:600; font-style:italic; color:#00aaff;\">Step1.</span></p><p align=\"justify\"><span style=\" font-size:12pt;\">点击</span><span style=\" font-size:12pt; font-weight:600;\">&lt;浏览&gt;</span><span style=\" font-size:12pt;\">按钮，在弹出的文件选择对话框中选择您需要压缩的PDF文件</span></p><p align=\"justify\"><img src=\":/usage/fig_1.png\"/></p><p align=\"justify\"><span style=\" font-size:12pt; font-weight:600; font-style:italic; color:#00aaff;\">Step2.</span></p><p align=\"justify\"><span style=\" font-size:12pt;\">在压缩参数面板中选择合适的压缩质量，现将三种压缩质量说明如下：</span></p><p align=\"justify\"><img src=\":/usage/fig_3.png\"/></p><p align=\"justify\"><span style=\" font-size:12pt; font-weight:600;\">低质量</span><span style=\" font-size:12pt;\"> - 图像为72ppi，较为模糊，大约能压缩至原始大小的50%-80%。</span></p><p align=\"justify\"><span style=\" font-size:12pt; font-weight:600;\">中质量</span><span style=\" font-size:12pt;\"> - 图像为150ppi，一般清晰，大约能压缩至原始大小的70%-90%。</span></p><p align=\"justify\"><span style=\" font-size:12pt; font-weight:600;\">高质量</span><span style=\" font-size:12pt;\"> - 图像为300ppi，很清晰，大约能压缩至原始大小的90%-100%。</span></p><p align=\"justify\"><span style=\" font-size:12pt;\">（</span><span style=\" font-size:12pt; text-decoration: underline;\">甚至比原始文件大</span><span style=\" font-size:12pt;\">）</span></p><p align=\"justify\"><span style=\" font-size:12pt; font-weight:600; font-style:italic; color:#00aaff;\">Step3.</span></p><p align=\"justify\"><span style=\" font-size:12pt;\">点击</span><span style=\" font-size:12pt; font-weight:600;\">&lt;执行压缩&gt;</span><span style=\" font-size:12pt;\">按钮，选择新文件的储存路径和文件名。</span></p><p align=\"justify\"><img src=\":/usage/fig_4.png\"/></p><p align=\"justify\"><span style=\" font-size:12pt; font-weight:600; font-style:italic; color:#00aaff;\">Step4.</span></p><p align=\"justify\"><span style=\" font-size:12pt;\">等待进度条执行到</span><span style=\" font-size:12pt; font-weight:600;\">100%</span><span style=\" font-size:12pt;\">后，单击</span><span style=\" font-size:12pt; font-weight:600;\">&lt;确认&gt;</span><span style=\" font-size:12pt;\">按钮即可。</span></p><p align=\"justify\"><img src=\":/usage/fig_5.png\"/><span style=\" font-size:12pt;\"><br/></span></p><p align=\"justify\"><br/></p><p align=\"justify\"><br/></p><p align=\"justify\"><br/></p><p align=\"justify\"><br/></p><p align=\"justify\"><br/></p><p align=\"justify\"><span style=\" font-size:18pt; font-weight:600; color:#bc0000;\">·视频压缩</span></p><p align=\"justify\"><span style=\" font-size:12pt;\">对于视频压缩，本软件提供两种压缩方案：</span></p><p align=\"justify\"><span style=\" font-size:12pt; font-weight:600;\">智能压缩 - </span><span style=\" font-size:12pt;\">自动计算合适的视频码率、帧率和分辨率，目的是将视频压缩至</span><span style=\" font-size:12pt; font-weight:600;\">60M</span><span style=\" font-size:12pt;\">以下，以满足</span><span style=\" font-size:12pt; font-weight:600; text-decoration: underline;\">师范生培养信息系统</span><span style=\" font-size:12pt;\">对上传文件大小的要求。</span></p><p align=\"justify\"><span style=\" font-size:12pt; font-weight:600;\">自定义压缩 - </span><span style=\" font-size:12pt;\">该方案适用于对视频压制有一定经验的人使用，关于视频压制格式、帧率、码率、分辨率对压制大小的影响在此不赘述，默认使用者有一定知识储备。</span></p><p align=\"justify\"><span style=\" font-size:12pt; font-weight:600; font-style:italic; color:#00aaff;\">Step1.</span></p><p align=\"justify\"><span style=\" font-size:12pt;\">点击</span><span style=\" font-size:12pt; font-weight:600;\">&lt;浏览&gt;</span><span style=\" font-size:12pt;\">按钮，在弹出的文件选择对话框中选择您需要压缩的视频文件。</span></p><p align=\"justify\"><img src=\":/usage/fig_6.png\"/></p><p align=\"justify\"><span style=\" font-size:12pt; font-weight:600; font-style:italic; color:#00aaff;\">Step2.</span></p><p align=\"justify\"><span style=\" font-size:12pt;\">本软件提供对视频的简单编辑，可以对视频截取一个连续片段。</span></p><p align=\"justify\"><span style=\" font-size:12pt;\">先简单介绍剪辑界面各个按钮的功能：</span></p><p align=\"justify\"><img src=\":/usage/fig_7.png\"/></p><p align=\"justify\"><span style=\" font-size:12pt;\">上图所示区域内，可见序号1-5所标部件，功能如下：</span></p><p align=\"justify\"><span style=\" font-size:12pt; font-weight:600;\">①</span><span style=\" font-size:12pt;\"> - 片段截取指示标记，用于标记用户截取的片段长度与位置。</span></p><p align=\"justify\"><span style=\" font-size:12pt; font-weight:600;\">②</span><span style=\" font-size:12pt;\"> - 视频播放进度条，用于标识视频播放的进度，以及用于标定剪辑时切入切出的位点。</span></p><p align=\"justify\"><span style=\" font-size:12pt; font-weight:600;\">③</span><span style=\" font-size:12pt;\"> - 标记切入点，用于标记截取片段的开始位置</span></p><p align=\"justify\"><span style=\" font-size:12pt; font-weight:600;\">④</span><span style=\" font-size:12pt;\"> - 播放/暂停按钮，用于控制视频的播放与暂停</span></p><p align=\"justify\"><span style=\" font-size:12pt; font-weight:600;\">⑤</span><span style=\" font-size:12pt;\"> - 标记切出点，用于标记截取片段的结束位置</span></p><p align=\"justify\"><span style=\" font-size:12pt; font-weight:600; text-decoration: underline;\">以下详述剪辑方法：</span></p><p align=\"justify\"><span style=\" font-size:12pt;\">首先点击</span><span style=\" font-size:12pt; font-weight:600;\">&lt;播放&gt;</span><span style=\" font-size:12pt;\">按钮,或拖动进度条，到想要截取片段</span><span style=\" font-size:12pt; font-weight:600;\">开头</span><span style=\" font-size:12pt;\">的位置，之后点击</span><span style=\" font-size:12pt; font-weight:600;\">&lt;标记切入点&gt;</span><span style=\" font-size:12pt;\">按钮（左花括号，上图③），可见上方红色标记左端点移动到标记位置。然后再点击</span><span style=\" font-size:12pt; font-weight:600;\">&lt;播放&gt;</span><span style=\" font-size:12pt;\">按钮，或拖动进度条，到想要截取片段</span><span style=\" font-size:12pt; font-weight:600;\">结束</span><span style=\" font-size:12pt;\">的位置，之后点击</span><span style=\" font-size:12pt; font-weight:600;\">&lt;标记切出点&gt;</span><span style=\" font-size:12pt;\">按钮（右花括号，上图⑤），可见上方红色标记右端点移动到标记位置。</span></p><p align=\"justify\"><img src=\":/usage/fig_8.png\"/></p><p align=\"justify\"><span style=\" font-size:12pt;\">随后请核对剪辑信息面板中的起止时刻是否合意。</span></p><p align=\"justify\"><span style=\" font-size:12pt; font-weight:600; font-style:italic; color:#00aaff;\">Step3.</span></p><p align=\"justify\"><span style=\" font-size:12pt;\">随后点击</span><span style=\" font-size:12pt; font-weight:600;\">&lt;智能压缩&gt;</span><span style=\" font-size:12pt;\">单选按钮。</span></p><p align=\"justify\"><img src=\":/usage/fig_9.png\"/></p><p align=\"justify\"><span style=\" font-size:12pt; font-weight:600; font-style:italic; color:#00aaff;\">Step4.</span></p><p align=\"justify\"><span style=\" font-size:12pt;\">随后点击</span><span style=\" font-size:12pt; font-weight:600;\">&lt;执行压缩&gt;</span><span style=\" font-size:12pt;\">按钮，选择新文件的储存路径和文件名。</span></p><p align=\"justify\"><img src=\":/usage/fig_10.png\"/></p><p align=\"justify\"><span style=\" font-size:12pt; font-weight:600; font-style:italic; color:#00aaff;\">Step5.</span></p><p align=\"justify\"><span style=\" font-size:12pt;\">等待进度条执行到</span><span style=\" font-size:12pt; font-weight:600;\">100%</span><span style=\" font-size:12pt;\">后，单击</span><span style=\" font-size:12pt; font-weight:600;\">&lt;确认&gt;</span><span style=\" font-size:12pt;\">按钮即可。</span></p><p align=\"justify\"><img src=\":/usage/fig_11.png\"/></p></body></html>"))
